	"sap/ui/documentation/sdk/view/Entity.view.xml":'<mvc:View controllerName="sap.ui.documentation.sdk.controller.Entity" xmlns:mvc="sap.ui.core.mvc" xmlns:core="sap.ui.core" xmlns:m="sap.m" xmlns:l="sap.ui.layout" xmlns="sap.uxap" xmlns:html="http://www.w3.org/1999/xhtml"><ObjectPageLayout id="ObjectPageLayout" useIconTabBar="true" selectedSection="samples" upperCaseAnchorBar="false" busyIndicatorDelay="0"><headerTitle><ObjectPageHeader id="entityHeader" objectTitle="{/name}"><actions><ObjectPageHeaderActionButton id="entityBackToSearch" text="Back to search results" hideIcon="true" hideText="false" press="backToSearch" visible="false"/><ObjectPageHeaderActionButton id="toggleFullScreenBtn" visible="{device&gt;/system/desktop}" icon="sap-icon://full-screen" tooltip="Show this sample in full screen mode" press="onToggleFullScreen"/></actions></ObjectPageHeader></headerTitle><headerContent><l:Grid defaultSpan="L4 M6 S12" class="sapUiNoMargin" hSpacing="0"><l:VerticalLayout width="98%" id="headerColumn0"/><l:VerticalLayout width="100%" id="headerColumn1" visible="false"/><l:VerticalLayout width="100%" id="headerColumn2" visible="false"/></l:Grid></headerContent><sections><ObjectPageSection id="about" title="About"><subSections><ObjectPageSubSection><l:VerticalLayout><core:HTML content="{/description}"/><l:VerticalLayout visible="{/show/introLink}"><m:Text text="{/shortDescription}"/></l:VerticalLayout></l:VerticalLayout></ObjectPageSubSection></subSections></ObjectPageSection><ObjectPageSection id="samples" title="Samples ({/count/samples})" visible="{= ${/count/samples} &gt; 0 }"><subSections><ObjectPageSubSection><m:Table class="myTable sapUxAPObjectPageSubSectionAlignContent" width="auto" id="table" items="{/entity/samples}" fixedLayout="false" showSeparators="Inner"><m:columns><m:Column><m:Label text="Name"/></m:Column><m:Column minScreenWidth="Tablet"><m:Label text="Description"/></m:Column></m:columns><m:items><m:ColumnListItem type="Navigation" press="onNavToSample" vAlign="Middle"><m:cells><m:Text text="{name}" class="entitySampleName" wrapping="false"/><m:FormattedText htmlText="{= ${path: \'description\'} ? ${path: \'description\'} : \'\'}"/></m:cells></m:ColumnListItem></m:items></m:Table></ObjectPageSubSection></subSections></ObjectPageSection></sections></ObjectPageLayout></mvc:View>',
	"sap/ui/documentation/sdk/view/FeedbackDialog.fragment.xml":'<core:FragmentDefinition xmlns="sap.m" xmlns:core="sap.ui.core" xmlns:html="http://www.w3.org/1999/xhtml"><Dialog title="Give Feedback" class="sapUiContentPadding" id="feedbackDialog" resizable="true" draggable="true" contentHeight="35rem" contentWidth="32rem" stretch="{appView&gt;/bPhoneSize}" showHeader="true"><content><VBox><HBox justifyContent="SpaceBetween"><items><Label text="How is your overall experience?" design="Bold" class="sapMFontMediumSize" required="true"/><ObjectStatus id="ratingStatus" text="" state="None" class="sapMFontMediumSize"/></items></HBox><HBox id="feedbackButtons"><items><ToggleButton id="excellent" width="100%" press="onPressRatingButton" icon="sap-icon://FeedbackRatingFaces/icon-face-very-happy" class="rateButton"><layoutData><FlexItemData growFactor="1"/></layoutData></ToggleButton><ToggleButton id="good" width="100%" press="onPressRatingButton" icon="sap-icon://FeedbackRatingFaces/icon-face-happy" class="rateButton"><layoutData><FlexItemData growFactor="1"/></layoutData></ToggleButton><ToggleButton id="average" width="100%" press="onPressRatingButton" icon="sap-icon://FeedbackRatingFaces/icon-face-neutral" class="rateButton"><layoutData><FlexItemData growFactor="1"/></layoutData></ToggleButton><ToggleButton id="poor" width="100%" press="onPressRatingButton" icon="sap-icon://FeedbackRatingFaces/icon-face-bad" class="rateButton"><layoutData><FlexItemData growFactor="1"/></layoutData></ToggleButton><ToggleButton id="veryPoor" width="100%" press="onPressRatingButton" icon="sap-icon://FeedbackRatingFaces/icon-face-very-bad" class="rateButton"><layoutData><FlexItemData growFactor="1"/></layoutData></ToggleButton></items></HBox><Label text="What would you like to tell us?" design="Bold" class="sapUiTinyMarginTop"/><TextArea id="feedbackInput" width="100%" placeholder="You can share your feedback for the overall Demo Kit experience or for the specific page you are currently viewing." rows="7" class="sapMFontMediumSize sapUiFeedbackDialogTextArea"/><CheckBox id="pageContext" text="Feedback is related to the current page" selected="true" class="sapMFontMediumSize contextCheckBoxAlign" select="onContextSelect"/><FormattedText class="sapMLabel sapUiFeedbackDialogNoteLabel sapUiTinyMarginBottom" htmlText="&lt;strong&gt;Note:&lt;/strong&gt; If you want to report a bug,    {= ${versionData&gt;/isOpenUI5} ?    \' you can open a GitHub issue &lt;a href=&quot;https://github.com/SAP/openui5/issues/new&quot;&gt;here.&lt;/a&gt;\' :    ${versionData&gt;/isSnapshotVersion} ?    \' please open a BCP ticket on CA-UI5-CTR component.\' :    \' you can report an Incident &lt;a href=&quot;https://launchpad.support.sap.com/#incident/solution&quot;&gt;here.&lt;/a&gt;\'    }    This way we will be able to get back to you in case we have follow-up questions."/><FormattedText class="sapMLabel sapUiFeedbackDialogNoteLabel sapUiTinyMarginBottom" visible="{= ${versionData&gt;/isOpenUI5}}" htmlText="You can contribute directly to the &lt;a href=&quot;https://github.com/SAP/openui5-docs&quot; target=&quot;_blank&quot;&gt;OpenUI5 Documentation&lt;/a&gt; on GitHub."/><Link text="Show context Data" class="sapMFontMediumSize sapUiTinyMarginBottom" press="onShowHideContextData"/><TextArea id="contextData" width="100%" value="Details/ descriptive text..." visible="false" editable="false" rows="3" class="sapUiBaseText sapMFontMediumSize sapUiTinyMarginBottom sapUiNoMarginTop"/><MessageStrip text="Your feedback is anonymous, we do not collect any personal data" type="Information" showIcon="true"/></VBox></content><beginButton><Button id="sendButton" text="Send" press="onFeedbackDialogSend" enabled="false" type="Emphasized"/></beginButton><endButton><Button id="cancelButton" text="Cancel" press="onFeedbackDialogCancel"/></endButton></Dialog></core:FragmentDefinition>',
	"sap/ui/documentation/sdk/view/Footer.fragment.xml":'<core:FragmentDefinition xmlns="sap.m" xmlns:l="sap.ui.layout" xmlns:core="sap.ui.core"><l:BlockLayoutCell class="demokitInitialPagesColorPatternFContrast sapUiDocumentationFooter"><FlexBox alignItems="{= ${device&gt;/system/phone} ? \'Start\' : \'Center\' }" justifyContent="SpaceBetween" direction="{= ${device&gt;/system/phone} ? \'Column\' : \'Row\' }" width="100%"><items><Image src="./resources/sap/ui/documentation/sdk/images/logo_sap.png" densityAware="false" width="3rem" height="1.5rem"/><FlexBox direction="{= ${device&gt;/system/phone} ? \'Column\' : \'Row\' }" class="sapUiTinyMarginTop"><items><Link class="demokitInitialPagesBrightLink sapUiLargeMarginEnd sapUiTinyMarginBottom" text="Legal Disclosure" href="https://www.sap.com/corporate/en/legal/impressum.html" target="_blank"/><Link class="demokitInitialPagesBrightLink sapUiLargeMarginEnd sapUiTinyMarginBottom" text="Privacy" href="https://www.sap.com/corporate/en/legal/privacy.html" target="_blank"/><Link class="demokitInitialPagesBrightLink" text="Terms of Use" href="https://www.sap.com/corporate/en/legal/terms-of-use.html" visible="{=!${versionData&gt;/isOpenUI5}}" target="_blank"/><Link class="demokitInitialPagesBrightLink sapUiTinyMarginBottom sapUiLargeMarginEnd" text="License" href="LICENSE.txt" visible="{versionData&gt;/isOpenUI5}" target="_blank"/><Link class="demokitInitialPagesBrightLink" text="Terms of Use" href="TermsOfUse.txt" visible="{versionData&gt;/isOpenUI5}" target="_blank"/></items></FlexBox></items></FlexBox></l:BlockLayoutCell></core:FragmentDefinition>',
