	"sap/ui/documentation/sdk/view/LiveEditor.view.xml":'<mvc:View controllerName="sap.ui.documentation.sdk.controller.LiveEditor" xmlns="sap.m" xmlns:l="sap.ui.layout" xmlns:core="sap.ui.core" xmlns:mvc="sap.ui.core.mvc" xmlns:custom="sap.ui.documentation.sdk.controls" xmlns:editor="sap.ui.codeeditor" xmlns:html="http://www.w3.org/1999/xhtml" class="liveEditor"><html:div class="editorWrapper">\n        <html:div>\n            <Title text="Live Editor"/>\n            <IconTabHeader selectedKey="{viewModel&gt;/selectedFileName}" select="onFileSwitch"><items><IconTabFilter text="App.view.xml" key="App.view.xml"/><IconTabFilter text="App.controller.js" key="App.controller.js"/><IconTabFilter text="index.js" key="index.js"/><IconTabFilter text="index.html" key="index.html"/></items></IconTabHeader>\n            <html:div class="editorSrcWindow">\n                <editor:CodeEditor id="srcEditor" editable="{= ${viewModel&gt;/selectedFileType} !== \'text\' }" value="{viewModel&gt;/selectedFileContent}" type="{viewModel&gt;/selectedFileType}" liveChange="onSrcLiveChange"/>\n            </html:div>\n        </html:div>\n\n        <VBox id="resultBox"><Title text="Result"/><Toolbar style="Clear" class="editorToolbar"><Button text="Preview" press="requestExecuteCurrentSrc" enabled="{= !${viewModel&gt;/autoPreview}}"/><CheckBox text="Auto-preview" selected="{viewModel&gt;/autoPreview}"/></Toolbar><core:HTML id="outputWindowWrapper" content="&lt;div &lt;/div&gt;"/></VBox>\n    </html:div></mvc:View>',
